import React, { Component } from 'react';
import './App.css';
import Hero from './Hero.js';
import Enemy from './Enemy.js';
import src from './logo.svg';
import empty from './empty.svg';

const items = [
    { name: "Amulet", zip: "1" , empty},
    { name: "Head", zip: "1"  , src},
    { name: "Ring", zip: "1"  , src},
    { name: "LeftHand", zip: "1"  , src},
    { name: "Armor", zip: "1"  , src},
    { name: "RightHand", zip: "1"  , src},
    { name: "Belt", zip: "1"  , src},
    { name: "Boots", zip: "1"  , src},
    { name: "Gauntlels", zip: "1"  , src},
    { name: "Item1", zip: "1"  , src},
    { name: "Item2", zip: "1"  , src},
    { name: "Item3", zip: "1"  , src},
];
const enemyItems = [
    { name: "Amulet", zip: "2" , src},
    { name: "Head", zip: "2"  , src},
    { name: "Ring", zip: "2"  , src},
    { name: "LeftHand", zip: "2"  , src},
    { name: "Armor", zip: "2"  , src},
    { name: "RightHand", zip: "2"  , src},
    { name: "Belt", zip: "2"  , src},
    { name: "Boots", zip: "2"  , src},
    { name: "Gauntlels", zip: "2"  , src},
    { name: "Item1", zip: "2"  , src},
    { name: "Item2", zip: "2"  , src},
    { name: "Item3", zip: "2"  , src},
];

class App extends Component {
    render() {
        return (
            <div className="App">
                <Hero items={items}/>
                <Enemy items={enemyItems}/>
            </div>
        );
    }
}

export default App;
